  \"2014-08-28T20:21:31.748982\",\n\t\"name\": \"wind-profiling-radar\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Clutter present in radar return signals
  as used for wind profiling is substantially removed by carrying out a Daubechies
  wavelet transformation on a time series of radar return signals. The smoothly varying
  nature of the return from clutter provides a relatively small number of high amplitude
  components in the wavelet transformation, which are truncated to remove the clutter.
  Inverse transformation yields a time series having had a significant amount of clutter
  removed, without distortion of the radar return from turbulence, which can then
  be processed to provide useful wind profile data.\",\n\t\"license_title\": \"License
